export type BfDsIconType = keyof typeof icons;
export type IconSizeType = 8 | 10 | 12 | 16 | 24 | 32 | 48 | 64 | 96 | 128;
type Props = {
  name: BfDsIconType;
  size?: IconSizeType;
  color?: string;
};

export function BfDsIcon(
  { name, size = 16, color = "var(--text)" }: Props,
) {
  return (
    <svg
      width={size}
      height={size}
      viewBox={icons[name]?.viewbox ?? "0 0 16 16"}
      fill={color}
      xmlns="http://www.w3.org/2000/svg"
    >
      {name && icons[name]?.paths.map((path, i) => {
        return <path key={i} d={path} fillRule="evenodd" clipRule="evenodd" />;
      })}
    </svg>
  );
}

const styles: Record<string, React.CSSProperties> = {
  row: {
    display: "flex",
    flexDirection: "row",
    flexWrap: "wrap",
    gap: 20,
  },
  icon: {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
  },
  text: {
    textAlign: "center",
  },
};

export function IconDemo() {
  return (
    <div style={styles.row}>
      {Object.keys(icons).map((icon) => (
        <div key={icon} style={styles.icon}>
          <BfDsIcon name={icon as BfDsIconType} size={32} />
          <div style={styles.text}>{icon}</div>
        </div>
      ))}
    </div>
  );
}
